var title_f32_56_33674="Vascular structures 2";
var content_f32_56_33674=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F56826&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=25\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F56826&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=25\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 692px\">",
"   <div class=\"ttl\">",
"    Vascular structures most commonly seen in nonmelanocytic tumors",
"    <sup>",
"     [1-3]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 672px; height: 723px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The presence of a given vessel morphology is not exclusive to a particular diagnosis. For example, arborizing vessels are commonly seen in basal cell carcinoma but they can also be seen in melanoma and intradermal nevi. Another example would be that although hairpin vessels are commonly associated with seborrheic keratoses, they can also be seen in melanoma. With that said, this table highlights vessels that are most commonly associated with non-melanocytic tumors.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Zalaudek I, Kreusch J, Giacomel J, et al. How to diagnose nonpigmented skin tumors: a review of vascular structures seen with dermoscopy: part II. Nonmelanocytic skin tumors. J Am Acad Dermatol 2010; 63:377.",
"       </li>",
"       <li>",
"        Zalaudek I, Kreusch J, Giacomel J, et al. How to diagnose nonpigmented skin tumors: a review of vascular structures seen with dermoscopy: part I. Melanocytic skin tumors. J Am Acad Dermatol 2010; 63:361.",
"       </li>",
"       <li>",
"        Argenziano G, Zalaudek I, Corona R, et al. Vascular structures in skin tumors: a dermoscopy study. Arch Dermatol 2004; 140:1485.",
"       </li>",
"       <li>",
"        Pan Y, Chamberlain AJ, Bailey M, et al. Dermatoscopy aids in the diagnosis of the solitary red scaly patch or plaque-features distinguishing superficial basal cell carcinoma, intraepidermal carcinoma, and psoriasis. J Am Acad Dermatol 2008; 59:268.",
"       </li>",
"       <li>",
"        Braun RP, Rabinovitz HS, Krischer J, et al. Dermoscopy of pigmented seborrheic keratosis: a morphological study. Arch Dermatol 2002; 138:1556.",
"       </li>",
"       <li>",
"        Ka VS, Clark-Loeser L, Marghoob AA. Vascular pattern in seborrheic keratoses and melanoma. Dermatol Surg 2004; 30:75.",
"       </li>",
"       <li>",
"        Altamura D, Menzies SW, Argenziano G, et al. Dermatoscopy of basal cell carcinoma: morphologic variability of global and local features and accuracy of diagnosis. J Am Acad Dermatol 2010; 62:67.",
"       </li>",
"       <li>",
"        Zalaudek I, Giacomel J, Argenziano G, et al. Dermoscopy of facial nonpigmented actinic keratosis. Br J Dermatol 2006; 155:951.",
"       </li>",
"      </ol>",
"      <br>",
"       Reproduced with permission from: Drs. Ashfaq Marghoob and Natalia Jaimes.",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
