var title_f32_56_33677="Frank Starling curves in HF";
var content_f32_56_33677=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F58693&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F58693&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Frank-Starling curves in HF",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 330px; height: 236px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Idealized family of Frank-Starling curves produced by worsening ventricular function in heart failure. In ventricles with normal cardiac performance, there is a steep and positive relationship between increased cardiac filling pressures (as estimated from the left ventricular end-diastolic or pulmonary capillary wedge pressure) and increased stroke volume or cardiac output (top curve). In comparison, during progression from mild to severe myocardial dysfunction, this relationship is right-shifted (ie, a higher filling pressure is required to achieve the same cardiac output) and flattened so that continued increases in left heart filling pressures lead to minimal increases in cardiac output at the possible expense of pulmonary edema. The onset of mild heart failure results in an initial reduction in cardiac function (point B), a change that can be normalized, at least at rest, by raising the LVEDP via fluid retention (point C). Diuretic therapy reduces left ventricular filling pressure at the expense of mildly decreased cardiac output (moving from point C to point B). In comparison, normalization of stroke volume is not attainable in severe heart failure (bottom curve).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
