" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 531px\">",
"   <div class=\"ttl\">",
"    Schematic diagram of a water treatment system for hemodialysis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 511px; height: 336px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic diagram of one possible water treatment system that begins with feed water entering the system at the left side. In our example (see text and tables), deionization (DI) has been included in addition to reverse osmosis because the required reduction in fluoride was close to the limit that can be achieved by reverse osmosis alone. Because a deionizer was included after the reverse osmosis unit, a bacteria- and endotoxin-retentive filter was added to protect the water storage and distribution system from bacterial contamination.",
